import React from 'react';
import { useSelector } from 'react-redux';
import Login from './features/auth/Login';
import Profile from './features/profile/Profile';

function App() {
    const token = useSelector((state) => state.auth.token);

    return (
        <div className="App">
            <h1>WFS Client</h1>
            {!token ? <Login /> : <Profile />}
        </div>
    );
}

export default App;
